October Girl #1 [MonkeyBrain Comics]

Autumn Ackerman has always known she was a little different, but she has no idea just how different she really is. 18 years old and with no hope for a future beyond working behind the counter at her small towns coffee shop, Autumn is about to discover that everything she thinks she knows about the world is wrong. The first chapter of a brand new dark fantasy story for teens and adults by critically acclaimed artist and writer Matthew Dow Smith (Doctor Who, Witchblade).

